import styled from "styled-components";

export const Wrap = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  align-items: center;

  > input {
    width: 330px;
    height: 40px;
    font-size: 18px;
    font-family: "Pretendard-Medium";
    border: 1px solid #b7bcc6;
    border-radius: 15px;
    padding: 12px 15px;
  }
`;
